  false,\n\t\"url\": null,\n\t\"notes\": \"This GIS dataset contains point features
  representing priority abandoned uranium mines in Navajo Nation, as determined by
  the US EPA and the Navajo Nation. USEPA and NNEPA prioritized mines based on gamma
  radiation levels, proximity to homes and potential for water contamination identified
  in the preliminary assessments. Attributes include Mine names, AUM region, reclaimed
  status, and links to US EPA reports. This dataset contains 58 features.\",\n\t\"owner_org\":
